package ProgramPractise;

public class pattern1 {

	public static void main(String[] args) {
		// TODO Auto-generated method stub

		
		for(int i=1;i<6;i++)
		{
			char a='a';
			for(int j=1;j<6;j++)
			{
				System.out.print(a+" ");
				a++;
			}
			
			System.out.println();
			
		}
		
		
	}

}
